import React from 'react';
import PropTypes from 'prop-types';

function EventItem({event}) {
    return(
        <li onClick={() => console.log(event.id)}>
            <span>
                {event.name}
            </span>
        </li>
    )
}

EventItem.propTypes = {
    event: PropTypes.object.isRequired
};

export default EventItem;
